import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Settings.module.css";

const Settings = (props) => {
  const changeLanguage = (ln) => {
    return () => 
    console.log(ln);
  }
  return (
    <div className={s.settings}>
      <NavLink className={s.header} to="/shop">
        <div className={s.back}>
          <span></span>
        </div>
        <div className={s.text}>Settings</div>
      </NavLink>
      <div className={s.language}>
        <div className={s.lText}>Language</div>
        <form>
          <select className={s.select} name="language" onChange={changeLanguage("en")}>
            <option value="en" onChange={changeLanguage("en")}>English</option>
            <option value="Default">Default</option>
            <option value="ru" onChange={changeLanguage("ru")}>Russia</option>
          </select>
        </form>
      </div>
    </div>
  );
};

export default Settings;
